import React from "react";

export default function Card() {
  const data = [
    {
      id: 1,
      img:
        "https://image.shutterstock.com/image-vector/female-legs-pantyhose-highheeled-shoes-600w-1989885866.jpg",
      name: "Leg bar"
    },
    {
      id: 2,
      img:
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRVDp-NzisExX9-gQZYe39tU-k91hj1wO_shg&usqp=CAU",
      name: "Meta Trap House"
    },
    {
      id: 3,
      img:
        "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR3284nrxrYiqVV2KJ1B0c1VvpKgXR7y0tImQ&usqp=CAU",
      name: "Girls Gone Wild"
    },
    {
      id: 4,
      img:
        "data:image/jpeg;base64,",
      name: "Meta Trap House"
    },

    {
      id: 5,
      img:
        "data:image/jpeg;base64,",
      name: "Cartoon"
    },
    {
      id: 6,
      img: "https://www.designdare.com/wp-content/uploads/2019/12/Zalgo.png",
      name: "ZALGO Ecosystem"
    }
  ];
  return (
    <div
      className="columns is-multiline"
      style={{ marginLeft: "-20px", marginTop: "6px" }}
    >
      {data.map((data) => (
        <div
          className="column is-one-third is-flex is-justify-content-space-around"
          style={{ height: "23rem" }}
          key={data.id}
        >
          <div
            className="card"
            style={{
              width: "27rem",
              backgroundColor: "black",
              borderRadius: "10px"
            }}
          >
            <img
              className="card-img-top"
              style={{ height: "13rem", width: "100%" }}
              src={data.img}
              alt="Card img cap"
            />
            <div className="card-body">
              <h2
                className="card-header"
                style={{
                  color: "white",
                  fontSize: "25px",
                  fontWeight: "bold",
                  marginLeft: "20px",
                  marginTop: "15px"
                }}
              >
                {data.name}
              </h2>
              <div className="small-div">
                @freezecorle...
                <p>0x890aac...</p>
              </div>
            </div>
          </div>
        </div>
      ))}
    </div>
  );
}
